        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()
  }
    render() {
        return (
            <div className="sheet">
                <div className='left container_for_medium_margin'>
                    <p>Let's look at this website to think through the challenges you might have had.</p>
                    <ol>
                        <li>Icebreaker game</li>
                        <li>Practicing coping strategies</li>
                        <li>Time for questions</li>
                        <li>Reminders about mentoring</li>
                        <li>Make a plan for practice</li>
                    </ol>
                </div>
            </div>
        )
    }
}
